import React from 'react'

const BotList = ({names, setNames}) => {
  return (
    <div>
      {names.map((name) => (
          <li className='list-item container' key={name.id}>
              {name.title}
              <div>
              {name.chip} &nbsp &nbsp;
              <button className='button-delete'>
              <i className="cis-trash"></i></button>
              </div>
          </li>
        )
      )}
    </div>
  )
}


export default BotList
